text:
my emotions cannot be expressed in words today. 25th november, international day of elimination of violence against women and i stand with my head up high saying we are rising. 
when i shared my story earlier this year, i thought it was just me. but then it went viral doing that, so many women have come forward too and i am proud to say that we are now a team & a sisterhood. i want the #metoo movement to spread into all communities.

women’s stories of abuse are hidden behind closed doors. we’re here to tell women that you can speak out, and there are people who will see and believe you.

i’d like to take this opportunity to thank the superstar behind the scenes @tarik_miah of @picturthat who went above and beyond to support this movement.

@actionaiduk for supporting us on the day and showing us that together we stand united against gender based violence. 
and my amazing team without which this day wouldn’t have been possible
@hudzyboo 
@j3ebu 
@hennaleaves 
@nilima.mua 
@makeup_bydaniella 
@jannatmedia 
@syra.photography 
@ish.photography_ 
@akmalhussain2078 
@the_secretgarden 
to watch the fun video, check out youtube. 
#idevaw2018

#metoo #believesurvivors #itsamansissuetoo #brokenbride #brokensectrets #itsnotok #enoughisenough #whydonthestop
 #whydon'tshestop #tedindia #vogueing #domesticviolencesurvivor

