text:
fière d’avoir marché ce 24/11 contre les violences sexistes et sexuelles, entourée de cette ferveur venant de tous les horizons. un rassemblement pour dire, encore une fois, que les mentalités doivent et peuvent évoluer, qu’il y en a ras-le-bol que la moitié de cette population humaine ne soit pas assez prise au sérieux, ras-le-bol de ressentir que notre corps ne nous appartient pas, ras-le-bol de pas être libre de marcher dans la rue tranquillement sans avoir le risque de se faire et pire, ras-le-bol de grandir en se demandant si moi aussi je ferais partie de ce trop grand nombre de femmes battues par leur conjoint, et puis ras-le-viol. il y a encore tellement de choses à dire, tant d’histoires et de personnes différentes. ce qui nous rassemble, ce qui nous fait evoluer c’est d’en parler, alors je vous en supplie, tout autour de vous, prenez la parole pour ceux qui doivent l’entendre. 📸 @compainmariellouise 
@karinepaoliphotographe 🎥 https://youtu.be/ufqcl5ohjpy

#noustoutes #jemarchele24 #feminism

