text:
[la nouvelle seine]
“de sirène sage qui rêve en ne disant mot à femme un peu plus libre de s'exprimer, le plongeon se fait par étapes pour nous toutes et maintenant que je suis dans ce bain là, fait de la joie de s'exprimer à bon escient, de partager, d'être ensemble avec plus d'authenticité, je peux vous l'affirmer: que c'est bon ! merci à toutes les merveilleuses femmes et sirènes qui plongent aussi, avant, en même temps, après moi, merci d'être là ❤️ merci”
@claire.assali

@lanouvelleseine est fière de présenter en cette saison 2018/19 la parole des femmes dans leurs diversitées. un an après #metoo ces voix sont plurielles, distinctes, précises et se coordonnent pour exprimer en place publique et sur notre scène les débats de notre société.

