text:
@blackdotfrance 
un code a faire connaître / un code qui veut dire : je suis victime j’ai besoin d’aide et j’ai des difficultés à en parler ⚫️ #bonasavoir 👉🏻👉🏼👉🏽 a partir du #25novembre à l’occasion de la journée internationale contre les violences faites aux femmes postez une photo de votre main avec #lepointnoir pour aider à faire connaître le code en #france #violencesconjugales #blackdotfrance 
it’s a sign against violence on women / the #blackdot sign means : i am a victim, i need help and can’t talk about it ⚫️ #goodtoknow #solidarity 👉🏻👉🏼👉🏽 from #november25th, on international day against violence on women, post a pic of your hand with the #blackdot to help make the sign known #timesup #endviolenceagainstwomen #stopauxviolencesfaitesauxfemmes #blackdotcampaign #metoo #domesticviolence

